import styles from './Form.module.css';
const Form = () => {
    return (
        <>
            <div className='form'>
                <div className='two-btn'>
                    <button><img src="" alt="" />VIA SUPPORT CHAT</button>
                    <button><img src="" alt="" />VIA CALL</button>
                </div>
                <button><img src="" alt="" />VIA EMAIL FORM</button>
                
            </div>
        </>
    )
}
export default Form;
